CREATE TABLE IF NOT EXISTS "django_migrations" ("id" serial NOT NULL PRIMARY KEY  , "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" serial  NOT NULL PRIMARY KEY  , "group_id" serial  NOT NULL REFERENCES "auth_group" ("id") , "permission_id" serial  NOT NULL REFERENCES "auth_permission" ("id") );
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" serial  NOT NULL PRIMARY KEY  , "user_id" serial  NOT NULL REFERENCES "auth_user" ("id") , "group_id" serial  NOT NULL REFERENCES "auth_group" ("id") );
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" serial  NOT NULL PRIMARY KEY  , "user_id" serial  NOT NULL REFERENCES "auth_user" ("id") , "permission_id" serial  NOT NULL REFERENCES "auth_permission" ("id") );
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" serial  NOT NULL PRIMARY KEY  , "action_time" timestamp NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" serial NOT NULL REFERENCES "django_content_type" ("id") , "user_id" serial  NOT NULL REFERENCES "auth_user" ("id") , "action_flag" smallint  NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" serial  NOT NULL PRIMARY KEY  , "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" serial  NOT NULL PRIMARY KEY  , "content_type_id" serial  NOT NULL REFERENCES "django_content_type" ("id") , "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" serial  NOT NULL PRIMARY KEY  , "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" serial  NOT NULL PRIMARY KEY  , "password" varchar(128) NOT NULL, "last_login" timestamp NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" timestamp NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "account_emailconfirmation" ("id" serial  NOT NULL PRIMARY KEY  , "created" timestamp NOT NULL, "sent" timestamp NULL, "key" varchar(64) NOT NULL UNIQUE, "email_address_id" serial  NOT NULL REFERENCES "account_emailaddress" ("id") );
CREATE TABLE IF NOT EXISTS "account_emailaddress" ("id" serial  NOT NULL PRIMARY KEY  , "verified" bool NOT NULL, "primary" bool NOT NULL, "user_id" serial  NOT NULL REFERENCES "auth_user" ("id") , "email" varchar(254) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_site" ("id" serial  NOT NULL PRIMARY KEY  , "name" varchar(50) NOT NULL, "domain" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp_sites" ("id" serial  NOT NULL PRIMARY KEY  , "socialapp_id" serial  NOT NULL REFERENCES "socialaccount_socialapp" ("id") , "site_id" serial  NOT NULL REFERENCES "django_site" ("id") );
CREATE TABLE IF NOT EXISTS "socialaccount_socialtoken" ("id" serial  NOT NULL PRIMARY KEY  , "token" text NOT NULL, "token_secret" text NOT NULL, "expires_at" timestamp NULL, "account_id" serial  NOT NULL REFERENCES "socialaccount_socialaccount" ("id") , "app_id" serial  NOT NULL REFERENCES "socialaccount_socialapp" ("id") );
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp" ("id" serial  NOT NULL PRIMARY KEY  , "provider" varchar(30) NOT NULL, "name" varchar(40) NOT NULL, "client_id" varchar(191) NOT NULL, "key" varchar(191) NOT NULL, "secret" varchar(191) NOT NULL);
CREATE TABLE IF NOT EXISTS "socialaccount_socialaccount" ("id" serial  NOT NULL PRIMARY KEY  , "provider" varchar(30) NOT NULL, "uid" varchar(191) NOT NULL, "last_login" timestamp NOT NULL, "date_joined" timestamp NOT NULL, "user_id" serial  NOT NULL REFERENCES "auth_user" ("id") , "extra_data" text NOT NULL);
CREATE TABLE IF NOT EXISTS "products_category" ("id" serial  NOT NULL PRIMARY KEY  , "name" varchar(254) NOT NULL, "friendly_name" varchar(254) NULL);
CREATE TABLE IF NOT EXISTS "products_product" ("id" serial  NOT NULL PRIMARY KEY  , "sku" varchar(254) NULL, "name" varchar(254) NOT NULL, "description" text NOT NULL, "price" decimal NOT NULL, "dimensions" varchar(254) NULL, "size" varchar(254) NULL, "rating" decimal NULL, "image_url" varchar(1024) NULL, "image" varchar(100) NULL, "category_id" serial  NULL REFERENCES "products_category" ("id") , "image2" varchar(100) NULL, "image3" varchar(100) NULL, "image_url2" varchar(1024) NULL, "image_url3" varchar(1024) NULL, "has_sizes" bool NULL);
CREATE TABLE IF NOT EXISTS "checkout_orderlineitem" ("id" serial  NOT NULL PRIMARY KEY  , "product_size" varchar(2) NULL, "quantity" serial  NOT NULL, "lineitem_total" decimal NOT NULL, "order_id" serial  NOT NULL REFERENCES "checkout_order" ("id") , "product_id" serial  NOT NULL REFERENCES "products_product" ("id") );
CREATE TABLE IF NOT EXISTS "profiles_userprofile" ("id" serial  NOT NULL PRIMARY KEY  , "default_phone_number" varchar(20) NULL, "default_country" varchar(2) NULL, "default_postcode" varchar(20) NULL, "default_town_or_city" varchar(40) NULL, "default_street_address1" varchar(80) NULL, "default_street_address2" varchar(80) NULL, "default_county" varchar(80) NULL, "user_id" serial  NOT NULL UNIQUE REFERENCES "auth_user" ("id") );
CREATE TABLE IF NOT EXISTS "checkout_order" ("id" serial  NOT NULL PRIMARY KEY  , "order_number" varchar(32) NOT NULL, "full_name" varchar(50) NOT NULL, "email" varchar(254) NOT NULL, "phone_number" varchar(20) NOT NULL, "country" varchar(2) NOT NULL, "postcode" varchar(20) NULL, "town_or_city" varchar(40) NOT NULL, "street_address1" varchar(80) NOT NULL, "street_address2" varchar(80) NULL, "county" varchar(80) NULL, "date" timestamp NOT NULL, "delivery_cost" decimal NOT NULL, "order_total" decimal NOT NULL, "grand_total" decimal NOT NULL, "original_bag" text NOT NULL, "stripe_pid" varchar(254) NOT NULL, "user_profile_id" serial  NULL REFERENCES "profiles_userprofile" ("id") );
